import React from 'react';
// import 'antd/dist/antd.css';

import Algorithms from './components/Algorithms'

class App extends React.Component {
  state = {
    pickedAlgorithm: 'sar',
    algorithms: [
      {
        name: 'sar',
        description: 'cos tam1'
      },
      {
        name: 'mm',
        description: 'cos tam2'
      },
      {
        name: 'uknn',
        description: 'cos tam3'
      }
    ]
  }

  pickedAlgorithm = (e) => {
      this.setState( {pickedAlgorithm: e.target.value})
  }

  render() {
      return (
          <div className="App">
              <Algorithms picked={this.state.pickedAlgorithm} algorithms={this.state.algorithms} pickedAlgorithm={this.pickedAlgorithm}/>
          </div>
      );
  }
}

export default App;
